import React from 'react';

const Sidebar = () => {
  return (
    <div className="sidebar p-3 border-end bg-light" style={{ width: '250px', height: '100vh' }}>
      <ul className="list-group">
        <li className="list-group-item">
          <a className="btn btn-outline-primary w-100" href="#">
            Dashboard
          </a>
        </li>
        <li className="list-group-item">
          <h3>Recents</h3>
        </li>
        <li className="list-group-item">
          <h3>History</h3>
        </li>
      </ul>
    </div>
  );
};

export default Sidebar;
